/**
*<div id="class.judy" class="reference">   <h1 class="title">The <a href="http://php.net/manual/zh/class.judy.php" class="classname">Judy</a> class</h1>     <div class="partintro"><p class="verinfo">(PECL judy &gt;= 0.1.1)</p>     <div class="section" id="judy.intro">    <h2 class="title">简介</h2>    <p class="para"> The Judy class implements the <a href="http://php.net/manual/zh/class.arrayaccess.php" class="link">ArrayAccess</a>  interface and the <a href="http://php.net/manual/zh/class.iterator.php" class="link">Iterator</a> interface.  This class, once instantiated, can be accessed like a <acronym title="PHP: Hypertext Preprocessor">PHP</acronym>  <a href="http://php.net/manual/zh/book.array.php" class="link">array</a>.    </p>    <p class="para" id="judy.types"> A PHP Judy object (or Judy Array) can be one of the following type : <ul class="simplelist">  <li class="member">{@link Judy::BITSET}</li>  <li class="member">{@link Judy::INT_TO_INT}</li>  <li class="member">{@link Judy::INT_TO_MIXED}</li>  <li class="member">{@link Judy::STRING_TO_INT}</li>  <li class="member">{@link Judy::STRING_TO_MIXED}</li> </ul>    </p>    <p class="para">     <div class="example" id="example-4521">       <div class="info"><p><strong>Example #1 Judy array example</strong></p></div>       <div class="example-contents"> <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"> <span style="color: #9876AA">&lt;?php<br />&nbsp;&nbsp;&nbsp;&nbsp;$judy&nbsp;</span><span style="color: #007700">=&nbsp;new&nbsp;</span><span style="color: #9876AA">Judy</span><span style="color: #007700">(</span><span style="color: #9876AA">Judy</span><span style="color: #007700">::</span><span style="color: #9876AA">INT_TO_MIXED</span><span style="color: #007700">);<br />&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #9876AA">$judy</span><span style="color: #007700">[</span><span style="color: #9876AA">1</span><span style="color: #007700">]&nbsp;=&nbsp;</span><span style="color: #DD0000">"one"</span><span style="color: #007700">;<br />&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #9876AA">$judy</span><span style="color: #007700">[</span><span style="color: #9876AA">2</span><span style="color: #007700">]&nbsp;=&nbsp;array(</span><span style="color: #DD0000">'a'</span><span style="color: #007700">,&nbsp;</span><span style="color: #DD0000">'b'</span><span style="color: #007700">,&nbsp;</span><span style="color: #DD0000">'c'</span><span style="color: #007700">);<br />&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #9876AA">$judy</span><span style="color: #007700">[</span><span style="color: #9876AA">3</span><span style="color: #007700">]&nbsp;=&nbsp;new&nbsp;</span><span style="color: #9876AA">Judy</span><span style="color: #007700">(</span><span style="color: #9876AA">Judy</span><span style="color: #007700">::</span><span style="color: #9876AA">BITSET</span><span style="color: #007700">);<br /></span><span style="color: #9876AA">?&gt;</span> </span> </span></div>       </div>      </div>    </p>   </div>     <div class="section" id="judy.synopsis">    <h2 class="title">类摘要</h2>      <div class="classsynopsis">     <div class="ooclass"></div>       <div class="classsynopsisinfo">      <span class="ooclass">       <strong class="classname">Judy</strong>      </span>            <span class="oointerface">implements        <span class="interfacename"><strong class="interfacename">ArrayAccess</strong></span>      </span>      <span class="oointerface">,        <span class="interfacename"><strong class="interfacename">Iterator</strong></span>      </span>      {</div>      <div class="classsynopsisinfo classsynopsisinfo_comment">// Constants </div>     <div class="fieldsynopsis">      <span class="modifier">const</span>      <span class="type" style="color:#EAB766">integer</span>       <var class="fieldsynopsis_varname"><a href="http://php.net/manual/zh/class.judy.php#judy.constants.bitset"><var class="varname">BITSET</var