an>Judy::STRING_TO_INT</span></strong></dt>       <dd>        <p class="para">Define the Judy Array with keys as a String and Values as Integer, and Integer only.</p>      </dd>                  <dt id="judy.constants.string-to-mixed"><strong><span>Judy::STRING_TO_MIXED</span></strong></dt>       <dd>        <p class="para">Define the Judy Array with keys as a String and Values of any type.</p>      </dd>           </dl>    </div>     </div>                                                                                                                                                 <h2>Table of Contents</h2><ul class="chunklist chunklist_reference"><li>{@link Judy::byCount} — Locate the Nth index present in the Judy array</li><li>{@link Judy::__construct} — Construct a new Judy object</li><li>{@link Judy::count} — Count the number of elements in the Judy array</li><li>{@link Judy::__destruct} — Destruct a Judy object</li><li>{@link Judy::first} — Search for the first index in the Judy array</li><li>{@link Judy::firstEmpty} — Search for the first absent index in the Judy array</li><li>{@link Judy::free} — Free the entire Judy array</li><li>{@link Judy::getType} — Return the type of the current Judy array</li><li>{@link Judy::last} — Search for the last index in the Judy array</li><li>{@link Judy::lastEmpty} — Search for the last absent index in the Judy array</li><li>{@link Judy::memoryUsage} — Return the memory used by the Judy array</li><li>{@link Judy::next} — Search for the next index in the Judy array</li><li>{@link Judy::nextEmpty} — Search for the next absent index in the Judy array</li><li>{@link Judy::offsetExists} — Whether a offset exists</li><li>{@link Judy::offsetGet} — Offset to retrieve</li><li>{@link Judy::offsetSet} — Offset to set</li><li>{@link Judy::offsetUnset} — Offset to unset</li><li>{@link Judy::prev} — Search for the previous index in the Judy array</li><li>{@link Judy::prevEmpty} — Search for the previous absent index in the Judy array</li><li>{@link Judy::size} — Return the size of the current Judy array</li></ul> <div class="up"><a href="http://php.net/manual/zh/book.judy.php">Judy</a></div></div>
