class Judy implements ArrayAccess {
    /**
     * Define the Judy Array as a Bitset with keys as Integer and Values as a Boolean.
     * @link http://php.net/manual/en/class.judy.php#judy.constants.bitset
     */
    const BITSET = 1;
    /**
     * Define the Judy Array with key/values as Integer, and Integer only.
     * @link http://php.net/manual/en/class.judy.php#judy.constants.int-to-int
     */
    const INT_TO_INT = 2;
    /**
     * Define the Judy Array with keys as Integer and Values of any type.
     * @link http://php.net/manual/en/class.judy.php#judy.constants.int-to-mixed
     */
    const INT_TO_MIXED = 3;
    /**
     * Define the Judy Array with keys as a String and Values as Integer, and Integer only.
     * @link http://php.net/manual/en/class.judy.php#judy.constants.string-to-int
     */
    const STRING_TO_INT = 4;
    /**
     * Define the Judy Array with keys as a String and Values of any type.
     * @link http://php.net/manual/en/class.judy.php#judy.constants.string-to-mixed
     */
    const STRING_TO_MIXED = 5;
    
    /**
     * (PECL judy &gt;= 0.1.1)<br/>
     * Construct a new Judy object. A Judy object can be accessed like a PHP Array.
     * @link http://php.net/manual/en/judy.construct.php
     * @param int $judy_type <p>The Judy type to be used.</p>
     * @return Judy <p>Return the new Judy instance.</p>
     */
    public function __construct($judy_type) {}

    /**
     * (PECL judy &gt;= 0.1.1)<br/>
     * Destruct a Judy object.
     * @link http://php.net/manual/en/judy.destruct.php
     */
    public function __destruct() {}

/**
*<div id="judy.bycount" class="refentry">  <div class="refnamediv">   <h1 class="refname">Judy::byCount</h1>   <p class="verinfo">(PECL judy &gt;= 0.1.1)</p><p class="refpurpose"><span class="refname">Judy::byCount</span> &mdash; <span class="dc-title">Locate the Nth index present in the <a href="http://php.net/manual/zh/class.judy.php" class="classname">Judy</a> array</span></p>   </div>    <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-judy.bycount-description">   <h3 class="title">说明</h3>   <div class="methodsynopsis dc-description" style="border:1px gray;padding-left:5px;background:#232525">    <span class="modifier">public</span> <span class="type" style="color:#EAB766">int</span> <span class="methodname" style="color:#CC7832"><strong>Judy::byCount</strong></span>     ( <span class="methodparam"><span class="type" style="color:#EAB766">int</span> <span class="parameter" style="color:#2EACF9">$nth_index</span></span>    )</div>    <p class="para rdfs-comment">    Locate the Nth index present in the <a href="http://php.net/manual/zh/class.judy.php" class="classname">Judy</a> array.   </p>     </div>     <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-judy.bycount-parameters">   <h3 class="title">参数</h3>   <dl>          <dt> <span class="parameter" style="color:#2EACF9">nth_index</span></dt>      <dd>       <span>       Nth index to return. If nth_index equal 1, then it will return the first index in the array.            </span>     </dd>        </dl>   </div>     <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-judy.bycount-returnvalues">   <h3 class="title">返回值</h3>   <p class="para">    Return the index at the given Nth position.    </p>  </div>      <div class="up"><a href="http://php.net/manual/zh/class.judy.php">Judy</a></div></div>
     * @return int <p>Return the index at the given Nth position.</p>*/
